import React from 'react';

export default class DataList extends React.Component {
    constructor(props) {
        super(props);
    }

    render(){
        return (
            <div id={this.props.data._id}>
                <li>
                    <div>{this.props.data.name}</div>
                    <div>{this.props.data.project}</div>
                    <div>{this.props.data.email}</div>
                    <div>{this.props.data.breakfast}</div>
                    <div>{this.props.data.lunch}</div>
                    <div>{this.props.data.dinner}</div>
                    <div>{this.props.data.lastName}</div>
                    <img src={this.props.data.pic} />
                    <div>{this.props.data.skill}</div>
                </li>
            </div>
        )
    }
}
